import Topic from "../pages/Topic";
import Answer from "../pages/Answer";
import PrivateRoutes from "../components/PrivateRoutes";

export const routes = [
  {
    path: "/",
    element: <LayoutDefault />,
    children: [
      {
        path: "/",
        element: <Home />
      },
      {
        path: "login",
        element: <Login />
      },
      {
        path: "register",
        element: <Register />
      },
      
      {
        element: <PrivateRoutes/>,
